              <Rectangle7 src={rectangle7} />
              <Background1 src={background1} />
            </OverlapGroup>
            <OverlapGroup5>
              <Ellipse8 src={ellipse8} />
              <Roadmap id="roadmap">
                <Roadmap1>{roadmap1}</Roadmap1>
                <PhaseContainer>
                  <Phase01>{phase01}</Phase01>
                  <Phase02>{phase02}</Phase02>
                  <Phase03>{phase03}</Phase03>
                </PhaseContainer>
                <GroupContainer>
                  <Group6322>{group63221Props.children}</Group6322>
